import React from 'react';
import s from './Category.module.css';

import './architect.svg';
import './avto.svg';
import './household.svg'

import {NavLink} from "react-router-dom";

const Category = (props) => {
    return (
        <div className={s.category}>
            <div className={`${s.categoryLogoEclipse} ${s.categoryLogo}`}>
                <img className={s.categoryLogo} src={props.imgPath} alt={''}/>
            </div>
            <NavLink className={s.categoryName} to={props.nameCategory.toLowerCase()}>{props.nameCategory}</NavLink>
        </div>
    );
};

export default Category;
